import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext'; // Wrap App with AuthProvider
import HomePage from './components/HomePage';
import LoginPage from './components/LoginPage';
import Dashboard from './components/Dashboard'; // Protected route (assuming you have one)
import About from './components/About';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<HomePage />} />       {/* HomePage: Landing page */}
          <Route path="/login" element={<LoginPage />} /> {/* LoginPage: Authentication */}
          <Route path="/dashboard" element={<Dashboard />} /> {/* Protected route */}
          <Route path="/about" element={<About />} />     {/* About page */}
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
